import React from "react";
import Position from "../components/position";
import "./4231style.css";

function Formation4231({ bestTeam, bestTeamRoles, handleRoleChange }) {

  const players = [
    "player0",
    "player1",
    "player2",
    "player3",
    "player4",
    "player5",
    "player6",
    "player7",
    "player8",
    "player9",
    "player10",
  ];



  return (
    <div className="formation4231">
      <div className="attackLane4231">
      <Position playerName={players[0]} positionName="ATTACK" onRoleChange={(role) => handleRoleChange(players[0], role)} selectedPlayer={bestTeam && `${bestTeam.player0.Nom} (${bestTeam.player0.Note})`} selectedRole={bestTeamRoles && `${bestTeamRoles.player0}`}/>
      </div>
      <div className="midLaneFront4231">
      <Position playerName={players[1]} positionName="AIL" onRoleChange={(role) => handleRoleChange(players[1], role)} selectedPlayer={bestTeam && `${bestTeam.player1.Nom} (${bestTeam.player1.Note})`} selectedRole={bestTeamRoles && `${bestTeamRoles.player1}`}/>
      <Position playerName={players[2]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[2], role)} selectedPlayer={bestTeam && `${bestTeam.player2.Nom} (${bestTeam.player2.Note})`}selectedRole={bestTeamRoles && `${bestTeamRoles.player2}`}/>
        <Position playerName={players[3]} positionName="AIL" onRoleChange={(role) => handleRoleChange(players[3], role)} selectedPlayer={bestTeam && `${bestTeam.player3.Nom} (${bestTeam.player3.Note})`}selectedRole={bestTeamRoles && `${bestTeamRoles.player3}`}/>
      </div>
      <div className="midLaneBack4231">
      <Position playerName={players[4]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[4], role)} selectedPlayer={bestTeam && `${bestTeam.player4.Nom} (${bestTeam.player4.Note})`} selectedRole={bestTeamRoles && `${bestTeamRoles.player4}`}/>
        <Position playerName={players[5]} positionName="MID" onRoleChange={(role) => handleRoleChange(players[5], role)} selectedPlayer={bestTeam && `${bestTeam.player5.Nom} (${bestTeam.player5.Note})`} selectedRole={bestTeamRoles && `${bestTeamRoles.player5}`} />
      </div>
      <div className="backLane4231">
        {renderPosition(6, "LAT")}
        {renderPosition(7, "DEF")}
        {renderPosition(8, "DEF")}
        {renderPosition(9, "LAT")}
      </div>
      <div className="gkLane4231">
        {renderPosition(10, "GK")}
      </div>
    </div>
  );
}

export default Formation4231;
